            <form id="form1">
              <div class="form-row">
                <div class="form-group col-md-3" style="text-align: center; display: none;">
                  <label for="name" style="color: red;font-size: 17px;"> TOKEN :</label>
                    <input type="password" id="token" value="NTYwNjA3NDg4NCAyMDIzLTA5LTIwIEZSRUVY" required="required"> <button type="button" id="checkBtn" class="btn btn-danger" >BUKA KUNCI </button>
                    <div class="error-message"></div>
                    <input type="text" id="idserver" readonly="readonly" style="display: none;">
                    <div class="error-message"></div>
                    <label for="exdate" id="exdate"></label>                  
                </div>
                <div class="form-group col-md-1">
                    <label for="mkiri">MODAL KIRI</label>
                    <input type="checkbox"  id="kiri"  class="myCheckbox2" checked="checked"> <input type="number" class="form-control" id="mkiri" name="input1" value="500" required>
                </div>
                <div class="form-group col-md-1">
                    <label for="mkiri">MODAL KANAN</label>
                    <input type="checkbox"  id="kanan"  class="myCheckbox2" checked="checked" > <input type="number" class="form-control" id="mkanan" name="input1" value="450" required>
                </div>
                <div class="form-group col-md-1">
                    <label for="mkiri">SCAN SPEED</label>
                    <select id="delay" name="delay" >
                      <option value="1750">STANDART</option>
                      <option value="1600" selected>MEDIUM</option>
                      <option value="1450">FAST</option>
                    </select>
                </div>
                <div class="form-group col-md-1">
                    <label for="netpnl">BRUTO PNL</label>
                    <input type="checkbox"  id="checkboxFilter" readonly checked="checked">
                    <input type="number" class="form-control" checked="checked"  id="netpnl" name="input1" value="18" required>
                </div>
                <div class="form-group col-md-1" style="display: none;">
                    <label for="netpnl">ID TELE</label>
                    <input type="number" class="form-control" checked="checked"  id="idtele" name="input1" required>
                </div>
                <div class="form-group col-md-2">
                  <div class="form-group">
                    <div><label for="input2">PAIR DEX</label></div>
                    <label for="option1">
                        <input type="radio" id="option1" name="radioOption"  value="USDT"> USDT
                    </label>
                    <label for="option4">
                        <input type="radio" id="option5" name="radioOption" value="BNT"> BNT
                    </label>
                    <label for="option4">
                      <input type="radio" id="option3" name="radioOption" value="WBTC"> WBTC
                   </label>
                    <label for="option5">
                        <input type="radio" id="option4" name="radioOption" checked="checked" value="ETH"> ETH
                    </label>

                </div>
                </div>
                <div class="form-group col-md-5">
                    <div id="akses">
                        <input  type="checkbox" id="1inch" checked class="myCheckbox"> <label class="form-check-label" for="autorun">1INCH</label>
                        <input type="checkbox" id="open"  class="myCheckbox"> <label class="form-check-label" for="autorun">OPEN</label>
                        <input type="checkbox" id="matcha" checked class="myCheckbox"> <label class="form-check-label" for="autorun">MATCHA</label>
                        <input type="checkbox" id="para" checked class="myCheckbox"> <label class="form-check-label" for="autorun">PARA</label>
                        <input type="checkbox" id="odos" checked class="myCheckbox"> <label class="form-check-label" for="autorun">ODOS</label>
                        <input type="checkbox"  id="autorun">     <label class="form-check-label" for="autorun">AUTORUN</label>&nbsp;&nbsp;

                    </div>
